<?php
$hexaVal = "";
$img = "";
//$lements = str_split
$cant = strlen($hexaVal);
for($i=2;$i<$cant;$i=$i+2){
    $hexadecimal = $hexaVal[$i].$hexaVal[$i+1];
    $decimal  = base_convert($hexadecimal,16,10);
    $cadena =  chr(intval($decimal));
    //echo "{$hexadecimal}({$decimal})({$cadena})<br>";
    $img .= $cadena;
}
header("content-type: image/jpg");
echo $img;
